import { createApp } from 'vue'; // Vue 3용 import
import App from './App.vue';
import router from './router'; // 라우터 설정 import

const app = createApp(App);

app.use(router); // Vue 3에서 라우터 등록
app.mount('#app'); // 애플리케이션 시작
